function visit1(fileurl)
{
    var request = require('request');
    var fs=require('fs');
    var req=request.get(
        {
            method: 'GET',
            uri: fileurl,
            headers: {"User-Agent": "Chrome/23.0.1271.97",
"Referer": 'http://list.shubhalabha.in/',
"Accept-Encoding": "",
"Accept": "text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8",
"Cookie": "cookie"
}
        });
req.pipe(fs.createWriteStream('sl.html'));
req.on('end',function(){
//return true;
console.log('\nvisited');
});
req.on('error',function(){
//return false;
console.log('\nnot visited');
});

}
